import {
  ButtonSearch,
  Logo,
  Menu,
  MenuItem,
  MenuRightSide,
  MenuRightSideItem,
  NavbarStyled,
  SeachModal,
  WrapperMenuAndLogo,
} from "./styles";

import SearchIcon from "./iconeSearch";

const Navbar = () => {
  return (
    <NavbarStyled>
      <WrapperMenuAndLogo>
        <Logo src="./images/logo.png" alt="Netflix" />

        <Menu>
          <ButtonSearch>
            <SearchIcon />
          </ButtonSearch>
          <MenuItem>BROWSE</MenuItem>
          <MenuItem>KIDS</MenuItem>
        </Menu>
      </WrapperMenuAndLogo>
    </NavbarStyled>
  );
};

export default Navbar;
